const initialState = ''

const filterSlice = createSlice({
    name: 'filterSearch',
    initialState,
    reducers: {
      applyThisFilter(state, action) {
        return action.payload
      }
    }
})

export const { applyThisFilter } = filterSlice.actions
export default filterSlice.reducer
